import { useState, useEffect  } from "react";
import axios from "axios";
import { Link } from "react-router-dom";


const baseUrl='http://127.0.0.1:8000/api';

function FAQ() {

    useEffect(()=>{
        document.title='FAQ';
    });

    const [faqData, setfaqData] = useState([]);
    

    useEffect(()=>{
        try{
            axios.get(baseUrl + '/faq/').then((res)=>{
                setfaqData(res.data);
            });
          }catch(error){
            console.log(error);
          }
    }, []);

   


    return (
        <>
      <div id="faq">
     
      <div className="container mt-4" >
        <div><h4 id="about-us-word">FAQ</h4></div>    
<div className="accordion" id="accordion-thing">
    {faqData && faqData.map((row, index)=> 
  <div className="accordion-item" id='faq-item'>
    <h2 className="accordion-header" id="headingOne">
      <button className="accordion-button collapse" id="faq-button" type="button" data-bs-toggle="collapse" data-bs-target="#collapseOne" aria-expanded="true" aria-controls="collapseOne">
        {row.question}
      </button>
    </h2>
    {index==0 &&
    <div id="collapseOne" className="accordion-collapse collapse show" aria-labelledby="headingOne" data-bs-parent="#accordionExample">
      <div className="accordion-body">
        {row.answer}
      </div>
    </div>
    }
    {index>0 &&
    <div id="collapseOne" className="accordion-collapse" aria-labelledby="headingOne" data-bs-parent="#accordionExample">
      <div className="accordion-body">
        {row.answer}
      </div>
    </div>
    }
  </div>
  )}
</div>
     </div>  
 


     </div>  
        </>
    );
}
export default FAQ;
